insert  into `about_pages`(`id`,`page_title`,`page_desc`,`our_story`,`mission_vision`,`created_at`,`updated_at`,`published_at`,`created_by_id`,`updated_by_id`,`locale`,`canonical`) values 
(1,'About myFirst Tech','A brand new collection for modern kids.','Designed for kids, created for parents, from parents! myFirst was founded by a team of super daddies who wanted to bridge the gap between technology and good old fashioned toys!\n\n\\\nAs a parent themselves, the myFirst founding fathers saw the need for their kids to engage more with new and advanced technology as the world developed. The lack of supply in the market that would guarantee the safe use of technology in kids greatly inspired the team to come up with creative and innovative designs.','myFirst envisions to redesign the way kids learn and play, in hopes of creating a community where children can grow up with technology safely introduced in their lives before they get in touch with the challenges of the adult tech world.\n\n\\\nThe team aims to focus on products that is high quality, reliable and functional, serving its purposes and solving each parentsâ€™ concern for their child. They would also want to cater to all kinds of parents, providing options to choose from for each product. myFirst greatly values feedback from parents and their children and will constantly improve their products from time to time.\n\n\\\nJoin us on our journey as we align the building blocks for building big and creative minds!','2023-11-04 03:47:30.940000','2023-11-06 15:41:28.872000','2023-11-04 03:47:33.467000',1,1,'en','https://myfirst.tech/about/');
