insert  into `components_components_block_components`(`id`,`title`,`desc`) values 
(1,'Customizable Watch Face With Fun Animated Wallpaper','Preset with a selection of new animated wallpaper. You can also customize your own watch face with your selfie or photos sent from others in the chat room.'),
(2,'Heart Rate Monitoring With High Heart Rate Alert','PPG (Photoplethysmography) Heart Rate Monitoring is added into the new R1s. Parents can set the high heart rate alert in the application remotely and once the R1s detected kid is running it will auto-detect the heart rate and will alert the user to slow down if exceeded the beats per minute set up by parents.'),
(3,'Improved Water Resistance With Rating IPX8','It has improved to IPX8 water resistance rating from the previous version of R1. The improvement sustains stronger and longer water resistance. Tested in the lab certified with 1 meter water depth for an hour.\n\n* Not advisable for shower & swimming'),
(4,'Record Your Own Personalised Reminder Voice','A new way to set up the reminder or alarm ringtone, train the kids to remind themselves by adding the voice message as the alarm or reminder. Parents can also set up the wake up call or alarm by their own customised recorded voice message~'),
(5,'Chat With Parent and Friends Using Emoji and Multiple Preset Texts','You can scroll to the right and choose from a list of handy and common phrases that the kids like, kids can now have a speedy reply without using the voice message.'),
(6,'Collect Badges Motivate Kids to Move','myFirst CareBuds also have a unique feature that automatically switches them to transparency mode when the earbuds detect body movement. This is a crucial safety feature for kids, as it allows them to hear their surroundings while walking on the road or engaging in other activities.'),
(7,'Precise Location','Getting lost has never been this fun! myFirst Fone R1s uses advanced GPS, WiFi and GSM to help parents accurately and conveniently track their kids.'),
(8,'Safe Zone','Keep your child within 200m from the boundaries of your holiday home. Preset safety zones for your kids by highlighting geo-locations in the iOS or Android app.'),
(9,'Class Mode','With flexible customization on class mode, R1s can be silenced at a specified day or time to minimize distractions. All calls and message alerts will be silent upon activation and only SOS function can be used.'),
(10,'One-Touch SOS','Send distress signals through an integrated SOS button. Once activated, parents will receive an emergency location alert with a 30s live recording of surrounding sounds.'),
(11,'4G LTE','Experience faster and smoother performance for all of their favourite fitness, health and productivity features on this smart watch for kids.'),
(12,'iOS & Android Compatible','myFirst Fone mobile app is compatible with iOS and Android devices. Parents can to remotely access information on their kidâ€™s watch phone with full parental control.'),
(13,'myFirst Fone S3','The myFirst Fone S3 is a smartwatch designed specifically for children. With a 1.4 inch square screen and a refined design, it comes with heart rate monitoring and a step tracking feature to help kids meet their daily fitness goals. The FoneOS on the watch allows children to easily stay in touch with family and friends, and enjoy features like messaging and calls, music playback, 2MP camera, GPS tracking and fitness tracking all in one device, making it one of the coolest smartwatch for kids on the market.\n'),
(14,'Fun with FoneOS','A kid-friendly smartwatch operating system can provide a lot of benefits for both kids and parents. FoneOS is the premier operating system designed specifically for kids and families. With its advanced communication capabilities, robust GPS tracking, and cutting-edge parental control features, FoneOS provides a safe and enjoyable experience for kids and peace of mind for parents.'),
(15,'The Ultimate Kidâ€™s Smartwatch Experience','In addition, FoneOS includes a variety of fun and educational features that encourage kids to learn and play. Whether youâ€™re a parent looking to keep your kids safe, or a kid looking for a fun and interactive smartwatch, FoneOS has you covered.'),
(16,'Quad Core','myFirst Fone S3 with a quad-core processor are designed specifically for children and offer a range of features for parents and kids alike. The quad-core processor improved performance and faster response times, making the user experience smoother and more enjoyable.'),
(17,'Group Chatting Made Easy','In addition to individual chats with parents or friends, the new S3 watch now offers group chat functionality. Set up a family chat room for easy and convenient communication with your loved ones. Or bring all your closest friends together in one place for fun and engaging group chats. With the S3â€™s group chat feature, you can stay connected with your important people all in one place. Say goodbye to the hassle of juggling multiple chat rooms and hello to more meaningful conversations.'),
(18,'Unlimited Data Plan With First 3 Months Free','myFirst Fone S3 comes with the pre-installed SIM during purchase. You may choose to sign up myFirst FreeSIM to activate the SIM card and enjoy FREE 3 months subscription.\n<br /><br />\nmyFirst FreeSIM is a data SIM without phone number. Singapore users can choose to subscribe to the <a href=\"/stay-connected/byof/\">Stay Connected â€“ Bring Your Own myFirst Fone</a> plan to use a SIM card with a phone number.'),
(19,'Precise Location','Getting lost has never been this fun! myFirst Fone R1s uses advanced GPS, WiFi and GSM to help parents accurately and conveniently track their kids.'),
(20,'1.4 Inch Screen','S3 features a vibrant and clear 1.4 inch IPS screen. This display technology provides a sharp and colorful viewing experience, making it easier for kids to read, navigate, and interact with their smartwatch.'),
(21,'Class Mode','With flexible customization on class mode, R1s can be silenced at a specified day or time to minimize distractions. All calls and message alerts will be silent upon activation and only SOS function can be used.'),
(22,'One-Touch SOS','Send distress signals through an integrated SOS button. Once activated, parents will receive an emergency location alert with a 30s live recording of surrounding sounds.'),
(23,'4G LTE','Experience faster and smoother performance for all of their favourite fitness, health and productivity features on this smart watch for kids.'),
(24,'iOS & Android Compatible','myFirst Fone mobile app is compatible with iOS and Android devices. Parents can to remotely access information on their kidâ€™s watch phone with full parental control.'),
(25,'Personalized Watch Faces with Fun Animated Wallpapers','S3 comes equipped with a collection of lively animated wallpapers, and you can also customize your watch face with your own selfies or photos sent from friends in the chat room.'),
(26,'Heart Rate Monitoring with High Heart Rate Alarm','S3 features PPG Heart Rate Monitoring, so parents can set high heart rate alerts remotely via the app. If your child is running and their heart rate exceeds the set limit, the watch will automatically detect it and issue an alert to slow down.'),
(27,'Enhanced Water Resistance with IPX8 Rating','S3 has been upgraded to an IPX8 water resistance rating, offering stronger and longer-lasting protection against water. The watch has been tested in a laboratory and certified to withstand 2 meter of water for up to an hour, although itâ€™s not recommended for showering or swimming.'),
(28,'85db Max Volume','The myFirst CareBuds are designed with the safety of young children in mind. With a maximum volume of 85db, these earbuds are specifically engineered to ensure that kids wonâ€™t be able to turn up the volume to potentially harmful levels.'),
(29,'Smart Transparency Mode','myFirst CareBuds also have a unique feature that automatically switches them to transparency mode when the earbuds detect body movement. This is a crucial safety feature for kids, as it allows them to hear their surroundings while walking on the road or engaging in other activities.'),
(30,'Easy Touch Controlâ€‹','The myFirst CareBuds come with user-friendly touch controls that make it easy for kids to play and stop music, pick up and end phone calls, and manually activate the transparency mode. This feature enables children to operate the earbuds with ease and convenience, without having to fumble with complicated buttons or controls.'),
(31,'Experience Clearer Audio','The new ENC (Environmental Noise Cancellation) Microphone in CareBuds uses special algorithms to cancel out background noise and improve voice quality during calls. This technology also helps to save battery life, so kids can enjoy listening to music or stories safely and comfortably, even in noisy places.'),
(32,'Kid-size Comfort','The myFirst CareBuds are designed with the comfort and fit of children in mind. They come with six different sizes of ear tips, ranging from large to extra small, ensuring a perfect fit for all ages of kids. With the right size ear tips, the myFirst CareBuds stay securely in place and provide a comfortable listening experience for hours on end. This feature ensures that kids can wear the earbuds comfortably and safely, without the risk of them falling out or causing discomfort.'),
(33,'Anti-Lost Strap','The myFirst CareBuds have an anti-lost strip to prevent loss, which kids can attach to the earbuds for added security.'),
(34,'Handy Strap','Come with a handy strap that kids can attach to the case, making it easy to carry around.'),
(35,'Convenient Earbuds Access','Feature a unique design with a slope inside the case, allowing kids to effortlessly take out the earbuds whenever they want to use them.'),
(36,'Easy Left & Right Earbuds Orientation','Left and right earbuds are easy to identify as soon as you open the case, making it simple to put them in the correct ear.'),
(37,'About myFirst',NULL),
(38,NULL,'With that in mind, the goal to creating and being the first tech product a child could safely use, they kick started myFirst back in 2017, with the launch of the pioneer myFirst Camera, which is now the #1 Kids camera brand in Korea!'),
(40,NULL,'myFirst aims to enrich a childâ€™s learning process by moulding experiences through fun and innovative gadgets. Designed to act as a gateway to a childâ€™s learning process. They aim to reinvent the way kids, no matter toddler or teen learn and embrace the technological era.'),
(41,NULL,'myFirst is now an established brand sold across Singapore, Japan, Korea, Sweden, Qatar, Dubai, Malaysia, Vietnam, Thailand, US, Philippines, Greece, UK and the USA!â€‹'),
