insert  into `privacy_policy_pages`(`id`,`page_title`,`page_desc`,`title`,`content`,`created_at`,`updated_at`,`published_at`,`created_by_id`,`updated_by_id`,`locale`,`canonical`) values 
(1,'Privacy Policy','myFirst Tech Privacy Policy','myFirst Privacy Policy','**Section 1 â€“ What Do We Do With Your Information?**\n\n\\\nWhen you purchase something from our store, as part of the buying and selling process, we will collect your personal information that you have shared with us, such as your name, address and email address.\n\n\\\nWhen you browse into our store, we will automatically receive your computerâ€™s internet protocol (IP) address as it provides us with information that will helps us to learn about your browser and operating system.\n\n\\\nEmail marketing (if applicable): With your permission, we may send you emails about our store, new products and other updates.\n\n\\\n**Section 2 â€“ Consent**\n\n\\\nHow do you get my consent?\n\n\\\nWhen you provide us with your personal information to complete a transaction, verifying your credit card, placing an order and arranging for a delivery or return a purchase, we imply that your consent to our data collection and uses it for that specific reason only.\n\n\\\nIf we ask for your personal information for a secondary reason, for marketing purposes, we will either ask you directly for your expressed consent, or we will provide you with an opportunity to say no.\n\n\\\nHow do I withdraw my consent?\n\n\\\nIf after you opt-in, you change your mind, you may withdraw your consent from us contacting you, for the continued collection, use or disclosure of your information, at any time, by contacting us at hello@myfirst.tech or mailing us at:\n\n\\\nOAXIS ASIA Pte Ltd\n31 Woodlands Close,\n#01-22 Woodlands Horizon Singapore 737855\n\n\\\n**Section 3 â€“ Disclosure**\n\n\\\nWe may disclose your personal information if we are required by law to do so or if you violate our Terms of Service.\n\n\\\n**Section 4 â€“ Online Store**\n\n\\\nOur store is hosted on Shopify Inc. They provide us with the online e-commerce platform that allows us to sell our products and services to you.\n\n\\\nYour data is stored through Shopifyâ€™s data storage, databases and the general Shopify application. They store your data on a secure server behind a firewall.\n\n\\\nPayment:\n\n\\\nIf you choose a direct payment gateway to complete your purchase, then Shopify stores your credit card data. It is encrypted through the Payment Card Industry Data Security Standard (PCI-DSS). Your purchase transaction data is stored only as long as is necessary to complete your purchase transaction. After that is complete, your purchase transaction information is deleted.\n\n\\\nAll direct payment gateways adhere to the standards set by PCI-DSS as managed by the PCI Security Standards Council, which is a joint effort of brands like Visa, MasterCard, American Express and Discover.\n\n\\\nPCI-DSS requirements help ensure the secure handling of credit card information by our store and its service providers. For more insight, you may also want to read Shopifyâ€™s Terms of Service (https://www.shopify.com/legal/terms) or Privacy Statement (https://www.shopify.com/legal/privacy).\n\n\\\n**Section 5 â€“ Third-Party Services**\n\n\\\nIn general, the third-party providers used by us will only collect, use and disclose your information to the extent necessary to allow them to perform the services they provide to us.\n\n\\\nHowever, certain third-party service providers, such as payment gateways and other payment transaction processors, have their own privacy policies in respect to the information we are required to provide to them for your purchase-related transactions.\n\n\\\nFor these providers, we recommend that you read their privacy policies so you can understand the manner in which your personal information will be handled by these providers.\n\nIn particular, remember that certain providers may be located in or have facilities that are located a different jurisdiction than either you or us. So if you elect to proceed with a transaction that involves the services of a third-party service provider, then your information may become subject to the laws of the jurisdiction(s) in which that service provider or its facilities are located.\n\n\\\nAs an example, if you are located in Canada and your transaction is processed by a payment gateway located in the United States, then your personal information used in completing that transaction may be subject to disclosure under United States legislation, including the Patriot Act.\nOnce you leave our storeâ€™s website or are redirected to a third-party website or application, you are no longer governed by this Privacy Policy or our websiteâ€™s Terms of Service.\n\n\\\nLinks\n\n\\\nWhen you click on links on our store, they may direct you away from our site. We are not responsible for the privacy practices of other sites and encourage you to read their privacy statements.\n\n\\\n**Section 6 â€“ Security**\n\n\\\nTo protect your personal information, we take reasonable precautions and follow industry best practices to make sure it is not inappropriately lost, misused, accessed, disclosed, altered or destroyed.\n\n\\\nIf you provide us with your credit card information, the information is encrypted using secure socket layer technology (SSL) and stored with a AES-256 encryption. Although no method of transmission over the Internet or electronic storage is 100% secure, we follow all PCI-DSS requirements and implement additional generally accepted industry standards.\n\n\\\n**Section 7 â€“ Cookies**\n\n\\\nHere is a list of cookies that we use. Weâ€™ve listed them here so you that you can choose if you want to opt-out of cookies or not.\n\n\\\n_session_id, unique token, sessional, Allows Shopify to store information about your session (referrer, landing page, etc).\n\n_shopify_visit, no data held, Persistent for 30 minutes from the last visit, Used by our website providerâ€™s internal stats tracker to record the number of visits\n\n_shopify_uniq, no data held, expires midnight (relative to the visitor) of the next day, Counts the number of visits to a store by a single customer.\n\n\\\ncart, unique token, persistent for 2 weeks, Stores information about the contents of your cart.\n\n\\\n_secure_session_id, unique token, sessional\n\nstorefront_digest, unique token, indefinite If the shop has a password, this is used to determine if the current visitor has access.\n\n\\\n**Section 8 â€“ Age of Consent**\n\n\\\nBy using this site, you represent that you are at least the age of majority in your state or province of residence, or that you are the age of majority in your state or province of residence and you have given us your consent to allow any of your minor dependents to use this site.\n\n\\\n**Section 9 â€“ Changes to This Privacy Policy**\n\n\\\nWe reserve the right to modify this privacy policy at any time, so please review it frequently. Changes and clarifications will take effect immediately upon their posting on the website. If we make material changes to this policy, we will notify you here that it has been updated, so that you are aware of what information we collect, how we use it, and under what circumstances, if any, we use and/or disclose it. If our store is acquired or merged with another company, your information may be transferred to the new owners so that we may continue to sell products to you.\n\n\\\nQuestions and Contact Information\n\n\\\nIf you would like to: access, correct, amend or delete any personal information we have about you, register a complaint, or simply want more information contact our Privacy Compliance Officer at hello@myfirst.tech .','2023-11-04 22:18:26.651000','2023-11-06 15:49:51.352000','2023-11-04 22:18:28.415000',1,1,'en','https://myfirst.tech/privacy-policy/');
